webpackJsonp([0x9edab9dd32b8],{1678:function(p,a){p.exports={data:{markdownRemark:{html:'<p>첫 번째 패스와 세계의 오래된 리더로 이동하십시오. 이곳은 역사상 잘 알려진 곳으로, 지나치게 많은 것 같아요. "세계 최초의 장소"라고 쓰여진 사람이 너무 많습니다. 건물 전체에는 고대 중국 건축의 특징이 있습니다. 역사적인 관점에서 보면 많은 역사가 있습니다.</p>\n<p>옛 리더는 만리장성 끝에 있었고 바다에 들어갔다. Shanhaiguan이 장소 이름은 또한 아마 산과 바다의 전송 의미가 있습니다. 불행하게도 고대의 자연은 많은 상업적인 색으로 불완전합니다. 황제와 퀸즈 복장을위한 수많은 대여 부스가 촬영되었으며 컴퓨터 운세, 게임기, 의자 리프트 등도 많은 종소리와 휘파람을 불렀습니다. 이러한 매점과 결합하여 구입 통화의 귀가 고객을 확보하고 사람들은 갑자기 향수를 잃었습니다.</p>\n<p>왜 이러한 포장 마차가 밖에 나가는 것이 허용되지 않는가? 작은 벽에 그런 큰 장소를 채워야 만 하는가? 이것은 국가에 문화적 문제와 문화적 문제가있다. 대부분의 사람들은 일종의 심리적 인 놀이를하고, 역사의 의미는없는 것처럼 보입니다. 이런 식으로,이 마구간에는 시장이 있습니다. 이 장소들이 깨끗 해지면 우리에게는 역사가 있고 사람들은 역사를 이해합니다. 중국인들에게 가장 큰 문제는 너무 많은 역사가 있고 너무 무거워서 아무도 너무 많은 역사를 가지고 싶어하지 않는다는 것입니다.</p>\n<p>"세계의 첫 번째 패스"에서 우리 팀은 황제의 사진도 찍었습니다. 그것은 완전히 모험이었습니다. 그러나 황제는 왜 사람들에게 매력적입니까? 다른 사람들은 아닙니다. 이것은 또 다른 수수께끼입니다.</p>\n<p>시를 잡아라.</p>\n<p>세계 최초의 패스</p>\n<p>밀레니엄 램프 (Millennium Ramp)</p>\n<p>Wall word 비문 Wenyu 와인.</p>\n<p>틴디의 웅장한 건물은 새로운 건물입니다.</p>\n<p>옛 생강 소녀의 눈물은 오래되었습니다.</p>\n<p>일회성 국가 지도자,</p>\n<p>마일즈는 바위에 머문다.</p>\n<p>Cang Lang의 고대 롤은 깃발을 격파했다.</p>\n<p>만리장성은 그 흐름을 무너 뜨 렸습니다.</p>',id:"/home/swain/workspace/political-life/src/pages/ko/0128.md absPath of file >>> MarkdownRemark",fileAbsolutePath:"/home/swain/workspace/political-life/src/pages/ko/0128.md",frontmatter:{title:"7월 29일 금요일"}}},pathContext:{id:"/home/swain/workspace/political-life/src/pages/ko/0128.md absPath of file >>> MarkdownRemark"}}}});
